import { HStack, Button } from '@chakra-ui/react'
import React from 'react'
import { Link } from 'react-router-dom'
const Header = () => {
    return (
        <HStack
            p={'4'}
            shadow={'base'}
            bgColor={'blackAlpha.900'}
        >
            <Button>
                <Link>
                </Link>
            </Button>
        </HStack>
    )
}

export default Header
